import React, {useState, useEffect} from 'react';
import axios from "axios";

export default function AllClasses(){
    const[classes, setClasses] = useState([]);

    const newAllClasses ={
        classes
      }

    useEffect(()=>{
        function getClasses() {
            axios.get("http://localhost:8070/class/").then((res)=>{
               setClasses(res.data);
               console.log(res);
        }).catch((err)=>{
            alert(err.message);
        })
        }
        getClasses();
    },[] ) 
    return(
        <div>
            <h1>All Classes</h1>
            {this.state.classes.map(classes =>(
                <div>
                    <p>{classes.classname}</p>
                    <p>{classes.grade}</p>
                    <p>{classes.date}</p>
                    <p>{classes.time}</p>
                    <p>{classes.link}</p>
                </div>
            ))}
        </div>
    )
    
}
